// Performance SLI
| fieldsAdd high=iCollectArray(if(avg[]> (1000 * toDouble($SLI_Threshold)), avg[]))
| fieldsAdd low=iCollectArray(if(avg[]<= (1000 * toDouble($SLI_Threshold)), avg[]))
| fieldsAdd highRespTimes=iCollectArray(if(isNull(high[]),0,else:1))
| fieldsAdd lowRespTimes=iCollectArray(if(isNull(low[]),0,else:1))
| fieldsAdd performance_sli=100*(lowRespTimes[]/(lowRespTimes[]+highRespTimes[]))

//Availability SLI
| fieldsAdd availability_good = total[]-failures[]
| fieldsAdd availability_sli=((availability_good[])/total[])*(100)
| summarize status = avg((performance_sli[]+availability_sli[])/2),by:{interval, timeframe}
| fields status = arrayRemoveNulls(status), interval, timeframe

